export default class NodeClass {
    constructor(id,name, fields, methods, width = 1, height = 1){
        this.id = id;
        this.name = name;
        this.fields = fields;
        this.methods = methods;
        this.width = width;
        this.height = height;
        this.x = 0;
        this.y = 0;
    }

    toString(){
        return this.name;
    }
}
